      fg = colors.purple,
      bg = colors.bg_statusline,
      bold = true,
    }

    -- Change inactive statusline too if you want
    hl.StatusLineNC = {
      fg = colors.comment,
      bg = colors.bg_statusline,
    }

    -- Optional: tweak lualine mode section text
    hl.LualineModeNormal = { fg = colors.bg, bg = colors.purple, bold = true }
    hl.LualineModeInsert = { fg = colors.bg, bg = "#cba6f7", bold = true }
    hl.LualineModeVisual = { fg = colors.bg, bg = "#f5c2e7", bold = true }
    hl.LualineModeReplace = { fg = colors.bg, bg = "#f38ba8", bold = true }
  end,

void add_task(node **head, const char* task) {
    node *tmp = malloc(sizeof(node));
    if (!tmp) return;

    strcpy(tmp->task, task);
    tmp->next = NULL;

    if (*head == NULL) {
        *head = tmp;
    }
    else {
        node *cursor = *head;
        while (cursor != NULL) {
            if (cursor->next == NULL) {
                cursor->next = tmp;
            }
            else {
                cursor = cursor->next;
            }
        }
    }
}

#include <ctype.h>
#include <stdbool.h>
#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#include "dictionary.h"

// Represents a node in a hash table
typedef struct node
{
    char word[LENGTH + 1];
    struct node *next;
} node;

// Choose number of buckets in hash table
#define N 26

// Hash table
node *table[N];

// Hashes word to a number
unsigned int hash(const char *word)
{
    if (!isalpha(word[0]))
        return 0;
    return toupper(word[0]) - 'A';
}

// Returns true if word is in dictionary, else false
bool check(const char *word)
{
    char lower[LENGTH + 1];
    int len = strlen(word);
    for (int i = 0; i < len && i < LENGTH; i++)
        lower[i] = tolower(word[i]);
    lower[len] = '\0';

    unsigned int index = hash(lower);
    node *cursor = table[index];

    while (cursor != NULL)
    {
        if (strcasecmp(cursor->word, lower) == 0)
            return true;
        cursor = cursor->next;
    }
    return false;
}

// Loads dictionary into memory, returning true if successful
bool load(char *dictionary)
{
    FILE *file = fopen(dictionary, "r");
    if (file == NULL)
        return false;

    char word[LENGTH + 1];
    while (fscanf(file, "%45s", word) != EOF)
    {
        node *new_node = malloc(sizeof(node));
        if (!new_node)
        {
            fclose(file);
            return false;
        }

        strcpy(new_node->word, word);
        new_node->next = NULL;

        unsigned int index = hash(word);
        new_node->next = table[index];
        table[index] = new_node;
    }

    fclose(file);
    return true;
}

// Returns number of words in dictionary if loaded
unsigned int size(void)
{
    unsigned int count = 0;
    for (int i = 0; i < N; i++)
    {
        node *cursor = table[i];
        while (cursor != NULL)
        {
            count++;
            cursor = cursor->next;
        }
    }
    return count;
}

// Unloads dictionary from memory
bool unload(void)
{
    for (int i = 0; i < N; i++)
    {
        node *cursor = table[i];
        while (cursor != NULL)
        {
            node *tmp = cursor;
            cursor = cursor->next;
            free(tmp);
        }
        table[i] = NULL;
    }
    return true;
}

bool load_into_list(node **head, char *word) {
    node *tmp = malloc(sizeof(node));
    if (!tmp) return false;
    strcpy(tmp->word, word);
    tmp->next = NULL;

    if (*head == NULL) {
        *head = tmp;
    } else {
        node *cursor = *head;
        while (cursor->next != NULL) {
            cursor = cursor->next;
        }
        cursor->next = tmp;
    }
    return true;
}

